import React from 'react'

import Tour from './Tour'

const Tours = ({tours}) => {
    return(
        <section>
            {tours.map((tour) => {
                <div>
                    return(
                        <Tour tour={tour.id}/>
                    )
                </div>
            })}
        </section>
    )
}

export default Tours
